CREATE OR REPLACE TABLE "DEMO_DB"."PUBLIC"."USERS" (id INT NOT NULL PRIMARY KEY, account_id INT, first_name VARCHAR(191), last_name VARCHAR(191), email VARCHAR(191), gender VARCHAR(191), ip_address VARCHAR(191), avatar VARCHAR(191), language VARCHAR(191), deactivated BOOLEAN, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE "DEMO_DB"."PUBLIC"."ADMINS" (id INT NOT NULL PRIMARY KEY, first_name VARCHAR(191), last_name VARCHAR(191), email VARCHAR(191), permission VARCHAR(191), created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE "DEMO_DB"."PUBLIC"."PURCHASES" (id INT NOT NULL PRIMARY KEY, user_id INT NOT NULL, item VARCHAR(191), category VARCHAR(191), price DECIMAL, state VARCHAR(191), created_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE "DEMO_DB"."PUBLIC"."PLANS" (id INT NOT NULL PRIMARY KEY, name VARCHAR(191), seats INT NOT NULL, monthly_rate INT NOT NULL);
CREATE OR REPLACE TABLE "DEMO_DB"."PUBLIC"."ACCOUNTS" (id INT NOT NULL PRIMARY KEY, name VARCHAR(191), domain VARCHAR(191), plan_id INT, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE "DEMO_DB"."PUBLIC"."PAYMENTS" (id INT NOT NULL PRIMARY KEY, account_id INT NOT NULL, amount DECIMAL, state VARCHAR(191), created_at TIMESTAMP NOT NULL);
